import { getIPv4 } from 'webrtc-ips';

// compressed base64 ips string was generated with https://hal9.com/javier/ips-by-country
const base64IPs = ''

var atoi = function atoi(addr) {
  var parts = addr.split('.').map(function(str) {
    return parseInt(str); 
  });

  return (parts[0] ? parts[0] << 24 : 0) +
          (parts[1] ? parts[1] << 16 : 0) +
          (parts[2] ? parts[2] << 8  : 0) +
          parts[3];
};

function inRange(ip, start, end) {
  var num = atoi(ip);
  return (num >= start) && (num <= end);
}

getIPv4().then(myip => {
  fetch(`data:application/octet-stream;base64,${base64IPs}`).then(res => {
    res.blob().then(async blob => {
      const all = new Uint32Array(await blob.arrayBuffer());
      
      const pairs = all.reduce(function(result, value, index, array) {
        if (index % 2 === 0)
          result.push(array.slice(index, index + 2));
        return result;
      }, []);

      debugger;
      const blocked = pairs.filter(pair => {
        return inRange(myip, pair[0], pair[1]);
      })

      if (blocked.length > 0) {
        document.body.innerHTML = 'This page is not available in your country.'
      }
    })
  })
})

